--
-- Name: get_item_invoice_usage("uuid", integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "public"."get_item_invoice_usage"("p_item_id" "uuid", "p_limit" integer DEFAULT 50) RETURNS TABLE("invoice_id" "uuid", "invoice_no" "text", "document_type" "text", "invoice_date" timestamp with time zone, "customer_name" "text", "quantity" numeric, "unit" "text", "rate" numeric, "amount" numeric)
    LANGUAGE "plpgsql"
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    inv.id AS invoice_id,
    inv.invoice_no,
    inv.document_type,
    inv.invoice_date,
    inv.customer_name,
    (item_data->>'quantity')::NUMERIC AS quantity,
    (item_data->>'unit')::TEXT AS unit,
    (item_data->>'rate')::NUMERIC AS rate,
    (item_data->>'amount')::NUMERIC AS amount
  FROM public.invoices inv,
  LATERAL jsonb_array_elements(inv.items::jsonb) AS item_data
  WHERE item_data->>'itemId' = p_item_id::TEXT
     OR item_data->>'item_id' = p_item_id::TEXT
  ORDER BY inv.invoice_date DESC
  LIMIT p_limit;
END;
$$;


