--
-- Name: record_stock_movement("uuid", "uuid", "uuid", "text", numeric, "text", "text", "uuid", "text", "uuid", "text", numeric, "text", "uuid"); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "public"."record_stock_movement"("p_organization_id" "uuid", "p_item_id" "uuid", "p_warehouse_id" "uuid", "p_transaction_type" "text", "p_entry_quantity" numeric, "p_entry_unit" "text", "p_reference_type" "text" DEFAULT NULL::"text", "p_reference_id" "uuid" DEFAULT NULL::"uuid", "p_reference_no" "text" DEFAULT NULL::"text", "p_party_id" "uuid" DEFAULT NULL::"uuid", "p_party_name" "text" DEFAULT NULL::"text", "p_rate_per_unit" numeric DEFAULT NULL::numeric, "p_notes" "text" DEFAULT NULL::"text", "p_created_by" "uuid" DEFAULT NULL::"uuid") RETURNS "uuid"
    LANGUAGE "plpgsql"
    AS $$
DECLARE
  v_item RECORD;
  v_warehouse_stock RECORD;
  v_base_quantity INTEGER;
  v_quantity_before INTEGER;
  v_quantity_after INTEGER;
  v_ledger_id UUID;
  v_quantity_change INTEGER;
BEGIN
  -- Get item details for conversion
  SELECT * INTO v_item FROM public.items WHERE id = p_item_id;
  
  IF NOT FOUND THEN
    RAISE EXCEPTION 'Item not found: %', p_item_id;
  END IF;
  
  -- Calculate base quantity based on entry unit
  IF p_entry_unit = v_item.packaging_unit AND v_item.per_carton_quantity IS NOT NULL THEN
    -- User entered in packaging units (e.g., CTN), convert to base units
    v_base_quantity := ROUND(p_entry_quantity * v_item.per_carton_quantity);
  ELSE
    -- User entered in base units (e.g., PCS)
    v_base_quantity := ROUND(p_entry_quantity);
  END IF;
  
  -- Determine if this is an IN or OUT transaction
  IF p_transaction_type IN ('IN', 'PURCHASE', 'RETURN', 'TRANSFER_IN', 'OPENING', 'ADJUSTMENT') THEN
    v_quantity_change := ABS(v_base_quantity);
  ELSE -- OUT, SALE, TRANSFER_OUT
    v_quantity_change := -ABS(v_base_quantity);
  END IF;
  
  -- Get or create warehouse stock record
  SELECT * INTO v_warehouse_stock 
  FROM public.item_warehouse_stock 
  WHERE item_id = p_item_id AND warehouse_id = p_warehouse_id;
  
  IF NOT FOUND THEN
    -- Create new warehouse stock record
    INSERT INTO public.item_warehouse_stock (
      item_id, warehouse_id, organization_id, quantity
    ) VALUES (
      p_item_id, p_warehouse_id, p_organization_id, 0
    ) RETURNING * INTO v_warehouse_stock;
  END IF;
  
  v_quantity_before := v_warehouse_stock.quantity;
  v_quantity_after := GREATEST(0, v_quantity_before + v_quantity_change);
  
  -- Update warehouse stock
  UPDATE public.item_warehouse_stock
  SET quantity = v_quantity_after,
      updated_at = NOW()
  WHERE id = v_warehouse_stock.id;
  
  -- Create ledger entry
  INSERT INTO public.stock_ledger (
    organization_id,
    item_id,
    warehouse_id,
    transaction_type,
    transaction_date,
    quantity_before,
    quantity_change,
    quantity_after,
    entry_quantity,
    entry_unit,
    base_quantity,
    rate_per_unit,
    total_value,
    reference_type,
    reference_id,
    reference_no,
    party_id,
    party_name,
    notes,
    created_by
  ) VALUES (
    p_organization_id,
    p_item_id,
    p_warehouse_id,
    p_transaction_type,
    NOW(),
    v_quantity_before,
    v_quantity_change,
    v_quantity_after,
    p_entry_quantity,
    p_entry_unit,
    v_base_quantity,
    p_rate_per_unit,
    CASE WHEN p_rate_per_unit IS NOT NULL THEN p_entry_quantity * p_rate_per_unit ELSE NULL END,
    p_reference_type,
    p_reference_id,
    p_reference_no,
    p_party_id,
    p_party_name,
    p_notes,
    p_created_by
  ) RETURNING id INTO v_ledger_id;
  
  RETURN v_ledger_id;
END;
$$;


--
-- Name: FUNCTION "record_stock_movement"("p_organization_id" "uuid", "p_item_id" "uuid", "p_warehouse_id" "uuid", "p_transaction_type" "text", "p_entry_quantity" numeric, "p_entry_unit" "text", "p_reference_type" "text", "p_reference_id" "uuid", "p_reference_no" "text", "p_party_id" "uuid", "p_party_name" "text", "p_rate_per_unit" numeric, "p_notes" "text", "p_created_by" "uuid"); Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON FUNCTION "public"."record_stock_movement"("p_organization_id" "uuid", "p_item_id" "uuid", "p_warehouse_id" "uuid", "p_transaction_type" "text", "p_entry_quantity" numeric, "p_entry_unit" "text", "p_reference_type" "text", "p_reference_id" "uuid", "p_reference_no" "text", "p_party_id" "uuid", "p_party_name" "text", "p_rate_per_unit" numeric, "p_notes" "text", "p_created_by" "uuid") IS 'Records stock movement with automatic unit conversion and ledger entry creation';


--
-- Name: update_item_total_stock(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "public"."update_item_total_stock"() RETURNS "trigger"
    LANGUAGE "plpgsql"
    AS $$
BEGIN
  -- Update the items table current_stock with sum from all warehouses
  UPDATE public.items
  SET current_stock = COALESCE((
    SELECT SUM(quantity) 
    FROM public.item_warehouse_stock 
    WHERE item_id = COALESCE(NEW.item_id, OLD.item_id)
  ), 0),
  updated_at = NOW()
  WHERE id = COALESCE(NEW.item_id, OLD.item_id);
  
  RETURN COALESCE(NEW, OLD);
END;
$$;


--
-- Name: update_stock_on_purchase(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "public"."update_stock_on_purchase"() RETURNS "trigger"
    LANGUAGE "plpgsql"
    AS $$
BEGIN
  IF TG_OP = 'INSERT' THEN
    UPDATE public.items
    SET current_stock = current_stock + NEW.quantity
    WHERE id = NEW.item_id;
  ELSIF TG_OP = 'UPDATE' THEN
    UPDATE public.items
    SET current_stock = current_stock - OLD.quantity + NEW.quantity
    WHERE id = NEW.item_id;
  ELSIF TG_OP = 'DELETE' THEN
    UPDATE public.items
    SET current_stock = current_stock - OLD.quantity
    WHERE id = OLD.item_id;
  END IF;
  RETURN NEW;
END;
$$;


--
-- Name: update_stock_on_sale(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION "public"."update_stock_on_sale"() RETURNS "trigger"
    LANGUAGE "plpgsql"
    AS $$
BEGIN
  IF TG_OP = 'INSERT' THEN
    UPDATE public.items
    SET current_stock = current_stock - NEW.quantity
    WHERE id = NEW.item_id;
  ELSIF TG_OP = 'UPDATE' THEN
    UPDATE public.items
    SET current_stock = current_stock + OLD.quantity - NEW.quantity
    WHERE id = NEW.item_id;
  ELSIF TG_OP = 'DELETE' THEN
    UPDATE public.items
    SET current_stock = current_stock + OLD.quantity
    WHERE id = OLD.item_id;
  END IF;
  RETURN NEW;
END;
$$;


