--
-- Name: customer_aging_analysis; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW "public"."customer_aging_analysis" AS
 SELECT "c"."id",
    "c"."name",
    "c"."phone",
    "c"."organization_id",
    COALESCE("sum"(
        CASE
            WHEN ("i"."status" = ANY (ARRAY['unpaid'::"text", 'partial'::"text", 'overdue'::"text"])) THEN "i"."balance"
            ELSE (0)::numeric
        END), (0)::numeric) AS "outstanding",
    COALESCE("sum"(
        CASE
            WHEN ((((CURRENT_DATE - "i"."invoice_date") >= 0) AND ((CURRENT_DATE - "i"."invoice_date") <= 30)) AND ("i"."status" = ANY (ARRAY['unpaid'::"text", 'partial'::"text", 'overdue'::"text"]))) THEN "i"."balance"
            ELSE (0)::numeric
        END), (0)::numeric) AS "current_0_30",
    COALESCE("sum"(
        CASE
            WHEN ((((CURRENT_DATE - "i"."invoice_date") >= 31) AND ((CURRENT_DATE - "i"."invoice_date") <= 60)) AND ("i"."status" = ANY (ARRAY['unpaid'::"text", 'partial'::"text", 'overdue'::"text"]))) THEN "i"."balance"
            ELSE (0)::numeric
        END), (0)::numeric) AS "overdue_31_60",
    COALESCE("sum"(
        CASE
            WHEN ((((CURRENT_DATE - "i"."invoice_date") >= 61) AND ((CURRENT_DATE - "i"."invoice_date") <= 90)) AND ("i"."status" = ANY (ARRAY['unpaid'::"text", 'partial'::"text", 'overdue'::"text"]))) THEN "i"."balance"
            ELSE (0)::numeric
        END), (0)::numeric) AS "overdue_61_90",
    COALESCE("sum"(
        CASE
            WHEN (((CURRENT_DATE - "i"."invoice_date") > 90) AND ("i"."status" = ANY (ARRAY['unpaid'::"text", 'partial'::"text", 'overdue'::"text"]))) THEN "i"."balance"
            ELSE (0)::numeric
        END), (0)::numeric) AS "overdue_above_90"
   FROM ("public"."customers" "c"
     LEFT JOIN "public"."invoices" "i" ON ((("i"."customer_id" = "c"."id") AND ("i"."organization_id" = "c"."organization_id"))))
  GROUP BY "c"."id", "c"."name", "c"."phone", "c"."organization_id";


