--
-- Name: v_item_stock_summary; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW "public"."v_item_stock_summary" AS
 SELECT "i"."id" AS "item_id",
    "i"."name" AS "item_name",
    "i"."item_code",
    "i"."unit" AS "base_unit",
    "i"."packaging_unit",
    "i"."per_carton_quantity",
    "i"."organization_id",
    COALESCE("sum"("iws"."quantity"), ("i"."current_stock")::bigint) AS "total_stock",
    "count"(DISTINCT "iws"."warehouse_id") AS "warehouse_count",
    "json_agg"("json_build_object"('warehouse_id', "w"."id", 'warehouse_name', "w"."name", 'quantity', COALESCE("iws"."quantity", 0), 'location', "iws"."location")) FILTER (WHERE ("w"."id" IS NOT NULL)) AS "warehouse_distribution"
   FROM (("public"."items" "i"
     LEFT JOIN "public"."item_warehouse_stock" "iws" ON (("i"."id" = "iws"."item_id")))
     LEFT JOIN "public"."warehouses" "w" ON (("iws"."warehouse_id" = "w"."id")))
  GROUP BY "i"."id", "i"."name", "i"."item_code", "i"."unit", "i"."packaging_unit", "i"."per_carton_quantity", "i"."organization_id", "i"."current_stock";


--
-- Name: VIEW "v_item_stock_summary"; Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON VIEW "public"."v_item_stock_summary" IS 'Aggregated view of item stock across all warehouses';


